ritage site in 2000. It is located at the altitude of 622 m\n\nFormerly known as Kesh (i.e., \"heart-pleasing\") and tentatively identified with the ancient Nautaca, Shahrisabz is one of Central Asia’s most ancient cities. It was founded more than 2700 years ago. its name was officially changed to Shahrisabz in the modern era. Timur regarded Shahrisabz as his “home town” and planned it eventually to be the location of his tomb. However, during the Timurid period, the center of activity shifted to Samarkand instead.','Shahrisabz - with a guide',NULL),(11,'2025-03-10 16:28:36','2025-03-10 16:28:36','Day','Daytour no guide','Transfer Private Samarkand Tashkent',NULL);
